import './TopBar.scss';
import {
  FaFacebookSquare,
  FaTwitterSquare,
  FaPinterestSquare,
  FaInstagramSquare,
} from 'react-icons/fa';

const TopBar = () => {
  return (
    <div className="top-bar">
      <div className="top-bar__left"></div>
      <div className="top-bar__center"></div>
      <div className="top-bar__right">
        <FaFacebookSquare />
        <FaTwitterSquare />
        <FaPinterestSquare />
        <FaInstagramSquare />
      </div>
    </div>
  );
};

export default TopBar;
